from typing import List

class Solution:
    def canSplitArray(self, nums: List[int], m: int) -> bool:
        def dfs(index, subarrays):
            if index == len(nums):
                return subarrays == len(nums)
            current_sum = 0
            for i in range(index, len(nums)):
                current_sum += nums[i]
                if current_sum >= m or i == len(nums) - 1:
                    if dfs(i + 1, subarrays + 1):
                        return True
                if current_sum < m:
                    break
            return False

        total_sum = sum(nums)
        if total_sum < m:
            return False
        return dfs(0, 0)
